function App() {
    const [users, setUsers] = useState("")



  return (
    <div className="App">
      <MenuUsers setUsers={setUsers} users={users}></MenuUsers>
      <FormAddUser setUsers={setUsers} users={users}></FormAddUser>
    </div>
  );
}



export default App;
